actionConfiguration.body:
() => {
  const quaters = [{
    x: "Jan-Mar",
    y: 0
  }, {
    x: "Apr-Jun",
    y: 0
  }, {
    x: "Jul-Sep",
    y: 0
  }, {
    x: "Oct-Dec",
    y: 0
  }];
  getMovies.data.forEach(item => {
    let val = moment(item.release_date).quarter();
    if (val) {
      quaters[val - 1].y += item.revenue;
    }
  });
  return quaters;
}

